<div id="everything">
  <div id="countLine">ZPPGs remaining: 12</div>
  <br>
  <div id="siteSelector"><input type="number" id="zNinput" pattern="\d+"><button onclick="select_site()">Select site</button></div>
  <br>
  <div id="recordLine">Selected Sites: </div>
  <br>
  <div id="resultLine"></div>
  <br>
  <div id="flavorLine"></div>
  <br>

</div>

ZPPGList = []

function select_site(){
 zN = document.getElementById("zNinput").value
 zN = Number(zN)
 if (Number.isInteger(zN)){
  if ((ZPPGList.indexOf(zN)<0)){
   if (ZPPGList.length<12){
    if (zN>=0){
    if (zN<Object.keys(ld).length){
    ZPPGList.push(zN)
    document.getElementById("recordLine").innerHTML= "Selected Sites: <br>"
    for (var i = 0; i < ZPPGList.length; i++) {
     document.getElementById("recordLine").innerHTML += (""+ZPPGList[i]+"<br>")
    }
    }
    }
   }
  }
 }
 
 zsRemaining = 12-ZPPGList.length
 document.getElementById("countLine").innerHTML="ZPPGs remaining: "+ zsRemaining
 
 if (zsRemaining==0){
  finale()
 }
}

function finale(){
 op = 0
 perfection = true
 
 document.getElementById("recordLine").innerHTML= "Selected Sites: <br>"
 
 for (var i = 0; i < ZPPGList.length; i++) {
  zN = ZPPGList[i]
  lo = lookup(zN)
  loToDisplay = (Math.floor(lo*100)/100)+"%"
  document.getElementById("recordLine").innerHTML+= (""+zN+": "+loToDisplay+"<br>")
  if (lo<100){
   perfection = false
  }
  op += lo
 }
 op = op/ZPPGList.length
 opToDisplay = (Math.floor(op*100)/100)+"%"
 
 document.getElementById("resultLine").innerHTML = "Average Performance: " + opToDisplay
 
 if (op<100){
  document.getElementById("flavorLine").innerHTML = "Your defiance of the Galactic Empress' authority achieves the typical result. (The level of pain is higher than is usual, but not statistically-significantly so.)"
 }
 if (op>=100){
  document.getElementById("flavorLine").innerHTML = "After days of disconcerting silence from the Empire, you're grudgingly allocated extra time and resources, to further study the SuperHyperSphere and optimize ZPPG output. Woe betide you if you fail."
 }
 if (perfection){
  document.getElementById("flavorLine").innerHTML = "Your point is made, and then some. The SuperHyperSphere is yours, to develop as you please. Now the real work begins."
 }
}
